  margin-top: 10%;
`
function isLogin() {
  const token = localStorage.getItem('token')
  if (token) {
    return true
  } else {
    return false
  }
}

function MyNickName() {
  let navigate = useNavigate()
  const { me } = useSelector((state) => state.user)

